// - Version beta 0.1
// - Last Update:  2018, June 22
// - Major changes in beta 0.1:
//		+ New syntax:
//			each element gets created by newX and retrieved by getX
//			commands come in 3 types: actions (.command), settings (.settings.command) and tests (.test.command)
//			'instructions' are no longer a thing
//			defaultX can be used to define commands to be automatically executed upon creation of each element X
//		+ Replaced all .record with settings.log
//		+ Elements get printed on the screen only when .print is called (exception when part of canvas)
//		+ Added .settings.left/right/center/color to each element
//		+ Added .settings.before/after to each element
//		+ Created a button element
//		+ Created a textInput element
//		+ Created a scale element (previously radio)
//		+ Created a HTML element
//		+ Created a voiceRecorder element
//		+ Can retrieve table with PennController.GetTable and filter them using .filter
//		+ Added a .logAppend command on PennController() to add values to each line for the trial in the results
// - Major changes in alpha 0.4:
//      + Revised the preloading method
//      + Replaced all .save with .record
//      + Added the FeedItems command
// - Major changes in alpha 0.3:
//      + Added the Canvas instruction
//      + Added the Instruction.id method

